import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import QueueForm from './components/QueueForm';
import TicketPrintWrapper from './components/TicketPrintWrapper';
import DisplayBoard from './components/DisplayBoard';
import QueueDisplay from './components/QueueDisplay'; // опционально

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<QueueForm />} />
        <Route path="/ticket" element={<TicketPrintWrapper />} />
        <Route path="/board" element={<DisplayBoard />} />
        <Route path="/display" element={<QueueDisplay />} />
      </Routes>
    </Router>
  );
}

export default App;
